return items.map(item => {
  // Parse the stringified JSON array
  const parsedData = JSON.parse(item.json.data);

  // Convert array of { name, value } into a flat object
  const flatData = {};
  for (const entry of parsedData) {
    flatData[entry.name] = entry.value;
  }

  return {
    json: {
      data_flat: flatData
    }
  };
});

function cleanSpaces(s) {
  return String(s ?? "").replace(/\s+/g, " ").trim();
}

function joinNonEmpty(parts, sep = ", ") {
  return parts.map(cleanSpaces).filter(Boolean).join(sep);
}

function dropByPrefix(obj, prefixes) {
  for (const key of Object.keys(obj)) {
    if (prefixes.some(p => key.startsWith(p))) delete obj[key];
  }
}

function dropByName(obj, names) {
  const nameSet = new Set(names.map(n => String(n).toLowerCase()));
  for (const key of Object.keys(obj)) {
    if (nameSet.has(String(key).toLowerCase())) delete obj[key];
  }
}

return items.map(item => {
  const j = item.json;
  const flat = { ...(j.data_flat || {}) };

  // 1) Remove unwanted checkbox/noise fields (case-insensitive)
  dropByName(flat, [
    "chkDocuSignCompleted",
    "pleasefill1",
    "chkDepositpaid",
    "chkEzidebitplan",
    // common typos / variants you mentioned
    "chkDepositpid",
    "chkexideit",
    "chkEzidebit",
    "chkEziDebitPlan"
  ]);

  // 2) Postage decision
  const postage = String(flat.Postage ?? flat.postage ?? "");

  if (postage.startsWith("Guest")) {
    dropByPrefix(flat, ["txtClinic", "txtCustom"]);

    const address1 = flat.txtGuestProfileAddress1;
    const address2 = flat.txtGuestProfileAddress2;
    const city     = flat.txtGuestProfileCity;
    const state    = flat.txtGuestProfileState;
    const postcode = flat.txtGuestProfilezipcode;

    flat.DeliveryAddressFull =
      cleanSpaces(address1) ||
      joinNonEmpty([address1, address2, city, state, postcode]);

  } else if (postage.startsWith("Clinic")) {
    dropByPrefix(flat, ["txtGuestProfile", "txtCustom"]);

    const address1 = flat.txtClinicAddress1;
    const address2 = flat.txtClinicAddress2;
    const suburb   = flat.txtClinicSuburb;
    const state    = flat.txtClinicState;
    const postcode = flat.txtClinicPostCode;

    flat.DeliveryAddressFull =
      cleanSpaces(address1) ||
      joinNonEmpty([address1, address2, suburb, state, postcode]);

  } else if (postage.startsWith("Custom")) {
    dropByPrefix(flat, ["txtGuestProfile", "txtClinic"]);

    const address1 = flat.txtCustomAddress1;
    const address2 = flat.txtCustomAddress2;
    const suburb   = flat.txtCustomSuburb;
    const state    = flat.txtCustomState;
    const postcode = flat.txtCustomPostCode;

    flat.DeliveryAddressFull =
      cleanSpaces(address1) ||
      joinNonEmpty([address1, address2, suburb, state, postcode]);
  }

  // 3) Output everything top-level (no nested data_flat)
  return {
    json: {
      is_form_submitted: j.is_form_submitted,
      ...flat,
      PostageDecision: postage
    }
  };
});

const ORIGINAL_NODE = "When Executed by Another Workflow";
const originalItems = $items(ORIGINAL_NODE);

function inferCleanedLocation(cleaned) {
  const decision = String(cleaned.PostageDecision ?? cleaned.Postage ?? "");
  if (decision.startsWith("Guest")) return "guest";
  if (decision.startsWith("Clinic")) return "clinic";
  if (decision.startsWith("Custom")) return "custom";
  return "";
}

function overwriteAddress(original, cleaned) {
  return {
    ...original,

    DeliveryAddress1:
      cleaned.DeliveryAddressFull ||
      cleaned.DeliveryAddress1 ||
      original.DeliveryAddress1,

    DeliveryAddressFull:
      cleaned.DeliveryAddressFull ||
      original.DeliveryAddressFull,

    DeliveryCity:
      cleaned.txtGuestProfileCity ??
      cleaned.txtClinicSuburb ??
      cleaned.DeliveryCity ??
      original.DeliveryCity,
  };
}

return items.map((cleanedItem, idx) => {
  const cleaned = cleanedItem.json;
  const original = originalItems[idx]?.json || {};

  const originalLoc = String(original.DeliveryLocation ?? "").toLowerCase();
  const cleanedLoc = inferCleanedLocation(cleaned);

  // Case 1: guest → guest (pass through original unchanged)
  if (originalLoc === "guest" && cleanedLoc === "guest") {
    return {
      json: {
        ...original,
        addresscompared: true
      }
    };
  }

  // Case 2: clinic → clinic (optional but sane default)
  if (originalLoc === "clinic" && cleanedLoc === "clinic") {
    return {
      json: {
        ...original,
        addresscompared: true
      }
    };
  }

  // Case 3: mismatch → overwrite address fields
  const merged = overwriteAddress(original, cleaned);

  return {
    json: {
      ...merged,
      addresscompared: true
    }
  };
});

